import React from "react";

function Todo({ todo, dispatch }) {
  console.log("todo", todo);
  const toggleCompleted = () => {
    dispatch({
      type: "TOGGLE-TODO",
      payload: todo.id
    });
  };
  return (
    <div
      onClick={toggleCompleted}
      className={`todo ${todo.completed ? "completed" : ""}`}
    >
      <h1>{todo.text}</h1>
    </div>
  );
}

export default Todo;
